    render() {
        return (
           <div className='calculator'>    
               <input type="text" placeholder='0' className='input' />
               <input className='button' type="button">0</input>
               <input className='button'>1</input>
               <input className='button'>2</input>
               <input className='button'>3</input>
               <input className='button'>4</input>
               <input className='button'>5</input>
               <input className='button'>6</input>
               <input className='button'>7</input>
               <input className='button'>8</input>
               <input className='button'>9</input>
               <input className='button'>+</input>
               <input className='button'>-</input>
               <input className='button'>*</input>
               <input className='button'>/</input>
               <input className='button'>=</input>
               <input className='button'>Clear</input>
           </div>
        )
    }
}
